 No refiere. 

Tabaco: (-) OH: (-) Drogas: (-) 

Medicamentos: 
 - ENL 10mg 1-0
- OMP 20mg 1-0
- ASA 100mg
- Calcio 
- desloratadina 1 al día. 

Motivo de IC: Fue derivada a neurólogo por cefalea de julio de 2014.
Se asocia a situación estresante coincidente con esa fecha, abandonando controles con médicos tratantes particulares y de hospital. 
Se constata situación estresante producto de lo anterior, siendo el sustento principal de la casa, incluso durmiendo 4 hrs diarias. 
Cefalea frontal, opresiva, con irradiación occipital. 
Sin embargo, refiere que aumenta en decúbito, y disminuye al ponerse de pie. 

Fue evaluada por ORL, quien diagnósticó bruxismo, recibiendo KNTM. 

Vómitos explosivos: (-) Sin cambios de carácter. 

Sin otros antecedentes a la anamnesis. 

Examen físico: 
 CLOTE. Hidratada. Bien perfundida. 
 Ojos: Pupilas isocóricas, reactivas. Conjuntivas rosadas. 
 Boca: Mucosas rosadas, hidratadas. 
 Cuello: Sin adenopatías. Sin soplos carotídeos. 
 RR2T, no ausculto soplos. 
 MP+, sin RA 
 Abdomen: Blando, depresible, indoloro. RHA+, no palpo masas. 
 EEII: Pulsos presentes: Sin edema, sin signos de TVP. 

Neurológico: 
 Conciencia: Orientada en Tº y Eº. Reactiva. 
 Pares craneanos, normales. 
 Reflejo corneal bilateral (+) 
 Reflejo nauseoso: (+) 
 Sensitivo: Impresiona leve disminución de sensibilidad en hemicuerpo derecho. 
 Motor: Difícil examinación por lesiones traumatológicas de paciente. Sin embargo, no impresiona paresia. 
 ROT: Normales. 
 Cerebeloso: Sin dismetría ni adiadococinesia. 

Paciente durante examen físico refiere mareos y cefalea al decúbito.

Solicito asesoría para descartar cefalea con signos de alarma, considerando incremento de la misma en decúbito y parestesia al examen neurológico. 

Muchas gracias. 
 Atte.', N'Cefalea en estudio. 
