Al ex: Paciente hemodinamicamente estable, gran dolor a la palpación perineal, sangrado activo por uretra. Resto normal.
Se intenta contactar a cirujano de turno del 06/03/16 Dra. Valenzuela quien no contesta por estar en pabellón.
Se decide enviar de manera urgente ante la posibilidad de laceración uretral, complicación con globo vesical y necesidad de evaluación por Urologo.
Paciente es evaluada por cirugía quien cuestiona la indicación de traslado, alegando que no le habíamos puesto Sonda Foley, lo cual a mi conocimiento es una contraindicación en la sospecha de ruptura traumática uretral. Se le coloca Sonda Foley y es enviado de vuelta a Hospital de Illapel.
Actualmente paciente con orinas con leve tinte hemático, sin globo vesical, hemodinámicamente estable.

