Complementar , este informe con ex fisico Genital completo realizado por medico general , en caso de necesidad agendar apoyo por VC  .', CAST(N'2015-10-30T03:00:00.0000000' AS DateTime2), 1, 0, N'Derivar a Urologia Infantil para contunar manejo , plazo maximo para ser derivado dentro de 30 dias ,', CAST(N'2015-09-15T16:03:16.8640000' AS DateTime2), CAST(N'2015-09-15T16:03:16.9430000' AS DateTime2), 2, 3)
