INSERT [requestAnswerDiagnoses] ([id], [evaluation], [confirmed], [description], [therapeuticPlan], [checkupDate], [checkupExamsRequired], [checkupSameSpecialist], [checkupComment], [createdAt], [updatedAt], [requestAnswerId], [checkupModeId]) VALUES (3, N'Paciente portador de un Ca de Prostata con PNag , me falta infromacion del Ca de porstata , cuando fue la Qx , Biopsia , quedo con algun tto medico , No me queda calro porque esta con Sonda Foley , recuerda que la causa que puede perpetuar la infección es la instrumentalización y la Sfoley , Si la Sonda esta por razones obstructuvas , habria que mantener , si esta por comodidad de la familia por causa de incontinencia secundaria a la Qx , abria que retirarla , este tema solo se puede saber si contamos con la info de la cirugia y el control post , respecto al uso de ATB , si esta asintomatico , afebril y con orina clara , mantener el tto ATB maximo por 14 dias en total y suspender .', 1, N'Pielonefritis complicada', NULL, NULL, NULL, NULL, NULL, CAST(N'2015-09-16T14:26:50.3600000' AS DateTime2), CAST(N'2015-09-16T14:26:50.4690000' AS DateTime2), 3, NULL)
GO
INSERT [requestAnswerDiagnoses] ([id], [evaluation], [confirmed], [description], [therapeuticPlan], [checkupDate], [checkupExamsRequired], [checkupSameSpecialist], [checkupComment], [createdAt], [updatedAt], [requestAnswerId], [checkupModeId]) VALUES (4, N'Si el paciente tiene una fimosis no reductible , la unica alternativa seria la cirugia , dependiendo el caso , una prepucioplastia o una circuncisión 
Tener cuidado con las complicaciones , una balanitis , ITU , parafimosis , etc . si aun no ha tenido ninguna de estas complicaciones ,  ha que estar atento 
Sugiero derivar a Cirugia Infantil para su resolución , este tipo de cirugia , es muy simple y la hacen tanto los urólogos como los cirujanos infantiles , podrías tambien consultar si el cirujano local la puede hacer .
En el intertanto solicitar los ex Preoperatorios ( HUGOP ) , ECG no seria necesario si tiene un ex cardio pulmonar normal  , deberias consultar al anestesista local si piden algún otro ex preop antes de la cirugia en pac pediatrico  , entendiendo que no tiene otra patologia asociada  , la idea es avanzar en este tema y prepararlo para la Qx.
Todo lo anterior entiendo que es una fimosis no reductible , si tienes dudas agendamos una VC , con el paciente para que lo veamos juntos', 1, N'Fimosis', N'1. Solicitar Ex preop y en caso necesario solicitar a Anestesista local , el protocolo de estudio preop para paciente pediatrico 
2. IC a cirugia Infantil , para su resolucion definitiva 
3. En caso necesario hacer VC con el paciente para ver el nivel de la lesion o enviar imagen', CAST(N'2015-09-25T03:00:00.0000000' AS DateTime2), 0, 1, N'SOLO EN CASO NECESARIO , CITAR A UNA ATENCION POR VC , TENGO DISPONIBILIDAD TODOS LOS LUNES DE 8 A 9:30
PARA ESTO LO CONFIRAMAS POR EL CHAT O CIERRAS EL CASO', CAST(N'2015-09-23T14:22:25.1930000' AS DateTime2), CAST(N'2015-09-23T14:22:25.3340000' AS DateTime2), 4, 2)
GO
