SI existiera ese síntoma cardinal debiera agregarse al menos uno de los siguientes: temblor de reposo de 4 a 6 hz, inestabildiad postural o rigidez en tubo de plomo.

Llama la atención en este caso la falla en control esfinteriano.
La enfermedad de parkinson NO comienza con dicha falla, solo es un hallazgo en cuadros avanzados.

