INSERT [request_answer_diagnoses] ([request_answer], [evaluation], [confirmed], [description], [therapeutic_plan], [checkup_date], [checkup_exams_required], [checkup_same_specialist], [checkup_comment], [checkup_mode], [id], [createdAt], [updatedAt]) VALUES (18, N'Paciente con cuadro de Colico renal recurrente , en estudio por Urolitiasis.
En un paciente con colico Renal es muy importante la semiologia del dolor para poder estimar la localización .
En el caso de este paciente , se requiere completar estudio de imagenes , lo ideal es poder contar con una Pielotac , en caso de no poder hacerla particular en Illapel , hacerle en el hospital una Rx renal y vesical simple para ver si el calculo es radio opaco , tamaño y localización , si tienes una equipo de ecografia a mano , le haria ademas una ecoscopia para descartar una HUN .
Seria buena adems saber si tiene alguna enf metabolica , Tipo Gota y pedir un Ac Urico 
Consultar si ha eliminado algun lito y que cuando tenga colico orine en un colador para objetivar que elimino el calculo .
Recuerda que los calculos de hasta 5mm , deberian pasar por el ureter con ayuda 
precaución  con el uso de antiespasmodicos', 1, N'Urolitiasis', N'En caso de Colico Renal usar la siguiente combinacion de farmacos:
1. ketoprofeno 50 mg c/8 hrs por 7 dias ( podrias usar otro Aine en caso de no tener Ketoprofeno )
2. Tamsulosina 0.4 mg /dia por 10 dias ( ojo con pacientes con tendencias a la hipotension )
3. Nefersil SOS.', CAST(N'2015-10-30T03:00:00.0000000' AS DateTime2), 1, 1, N'Enviar Imagenes cuando se dispongan para poder completar manejo', 1, 18, CAST(N'2015-10-22T12:32:35.1230000' AS DateTime2), CAST(N'2015-10-22T12:32:35.2800000' AS DateTime2))
