INSERT [request_answer_diagnoses] ([request_answer], [evaluation], [confirmed], [description], [therapeutic_plan], [checkup_date], [checkup_exams_required], [checkup_same_specialist], [checkup_comment], [checkup_mode], [id], [createdAt], [updatedAt]) VALUES (40, N'Se evalúa paciente hospitalizado , constatando un paciente añoso , con Hipoacusia severa , sin soporte familiar .
Al TR , se constata un prostata g2-3 ,auamentada de consistencia , e importante fecaloma en ampolla rectal , se hace derivación manual , e indica proctoclisis.
S foley n 16  de 3 vias con tinte hemático , se hace lavado vesical y evacuación de de globo vesical dando salida a aproximadamente 400 cc de Orina con tinte hematico e indica irrigacion vesical con SF , 10 LTS dia y hacer prueba de retiro s foley una vez evacuado el fecaloma .
Creo que el retiro fue muy pronto  , habia sugerido 48 hrs , con irrgacion y luego retiro dado la condicion basasl', 0, N'UOB , ROC MAS SAP', N'1. Reinstalar SFoley N 18 con lavado vesical 
2. Irrigacion vesical 10 lts de SF /dia 
3. Iniciar Tamsulosina  0,4 mg dia o en lo posible DUODART 1/dia antes de reitro de SFoley 
4. No iniciar tto ATB , a menos que este sinotmatico , es probabale que el cultivo salga alterado , por que esta colonizado o fue contaminación , si ya iniciaste tto ATB y es sensible a Cipro , mantener por 14 dias .
5. Asegura una buena hidratación 
6. Controla la función renal , CREA , ELP , BUN .
7. Te sugeiro Hacer una nueva retiro de s foley en 3 dias mas', CAST(N'2015-11-16T03:00:00.0000000' AS DateTime2), 1, 1, N'Dame una llamada el lunes a medio dia para contarme consige el paciente', 1, 38, CAST(N'2015-11-13T22:25:45.9430000' AS DateTime2), CAST(N'2015-11-13T22:25:46.8300000' AS DateTime2))
