INSERT [request_answer_diagnoses] ([request_answer], [evaluation], [confirmed], [description], [therapeutic_plan], [checkup_date], [checkup_exams_required], [checkup_same_specialist], [checkup_comment], [checkup_mode], [id], [createdAt], [updatedAt]) VALUES (42, N'Paciente Joven de 47 a tiene eco con evidencia de varicocele y un quiste de epididimo , ademas de una hernia inguinal reductible .
Es probable por historia y resultado de examenes que el dolor no sea referido a una causa genital .
En otras palabras su etiologia , es muy probable que no sea por el varicocele nj el quiste de epididimo.
Me falta información del tamaño del quiste ?
Si el tamaño de hernia amerita poner malla , sugiero operar primero la hernia , si es una hernia mas pequeña , se podria operar la hernia con un abordaje que ademas permita explorar el teste en el mismo momento', 1, N'Quiste epidídimo', N'Manejo con analgesicos durante 15 dias .
Paracetamol 500 c / 8 hrs x 15 dias 
